songs.lyrics:
Poète, bel ami
Clown cosmique maudit
Cœur caché des muslims
Philosophe des cimes
Dont la vie est musique
Soufi, roi des comiques
Salam, salam, salam

Enivré par l'amour
Simple comme bonjour
Rare aristocratique
Seigneur ésotérique
Monarque pauvre et fou
Arlequin plein de poux
Salam, salam, salam

Vaporeux loup d'argent
Et sauvage agneau blanc
Dans ton cœur font la paire
Cœur chassé de lumière
De vérité sans blâme
Et de beauté sans drame
Salam, salam, salam

Ton œil candide et fin
Ton œil jamais éteint
Ton œil malin et dur {x2}
Est un ciel d'hiver pur
Un lac gelé brillant {x2}
Dans le désert vibrant
Salam, salam, salam {x2}

Que Lui qui est le Tout {x2}
Nous embrase partout {x2}
Grâce à vous, grâce à nous {x2}
Qui tombons à genoux {x2}
Projetés sur la Terre {x2}
Devant grâce et mystère {x2}
Salam, salam, salam

Laïc et plein d'ivresse {x2}
Coranique sans messe {x2}
Chef d'état ou pécheur {x2}
Concierge ou balayeur {x2}
Peuvent être soufis {x2}
Sans que cela soit dit {x2}
Salam, salam, salam {x4}
